import { useState } from 'react';
import { Link,useNavigate } from 'react-router-dom';
import './Featured.scss';

const Featured = () => {
  const [search, setSearch] = useState('');
  const navigate = useNavigate();


  const handleSearch = () => {
    if(search) {
      navigate(`/gigs?search=${search}`);
    }
  }
  return (
    <div className='featured'>
      <div className="container">

        <div className="left">
          <h1>Your trusted <span>phising</span>detection platform</h1>
          <div className="search">
            <div className="searchInput">
              <img src="./media/search.png" alt="search" />
              <input type="search" placeholder='Enter the URL' onChange={(({ target: { value } }) => setSearch(value))} />
            </div>
            <button onClick={handleSearch}>Detect</button>
          </div>
          <div className="popular">





          </div>
        </div>

        <div className="right">
          <img src="./media/hero.png" alt="hero" />
        </div>

      </div>
    </div>
  )
}

export default Featured
